import React, { useEffect } from 'react';
import { useParams } from 'react-router-dom';

const UserProfile = () => {
  const { userId } = useParams();

  useEffect(() => {
    console.log('UserProfile component is mounted.');
    console.log('userId:', userId);

    // You can add additional logging or data fetching logic here

    return () => {
      console.log('UserProfile component is unmounted.');
    };
  }, [userId]);

  console.log('Rendering UserProfile component.');

  return (
    <div>
      <h1>User Profile</h1>
      {/* Add any other content you need */}
    </div>
  );
};

export default UserProfile;
